import React from 'react';
import ProgressTrackerLink from '../TeacherSide';
//image imports
import ProgressTracker from './TeacherBuilderIcons/small/Progressdark.png';
import StudentProfiles from './TeacherBuilderIcons/small/Iconawesome-user-graduate.png';
import ProjectSubmission from './TeacherBuilderIcons/small/submitproj.png';
import ProjectLibrary from './TeacherBuilderIcons/small/librarylight.png';
import HelpRequest from './TeacherBuilderIcons/small/Iconmaterial-live-help.png';
import TeacherProfile from './TeacherBuilderIcons/Ellipse38.png';



export const SidebarData = [
    {
        profile: <img
        class="TeacherProfile"
        src={TeacherProfile}
        alt="profileImage" />,
        cName: 'nav-image'
    },

    {
        title: 'PROGRESS TRACKER',
        path:
        src={ProgressTrackerLink},
        icon: <img
        class="ProgressTracker"
        src={ProgressTracker}
        alt="icon-1"/>,
        cName: 'nav-text',
        altName: 'panel-text'
        
    },
    {
        title: 'STUDENT PROFILES',
        path: '/Student',
        icon: <img
        class="StudentProfiles"
        src={StudentProfiles}
        alt="icon-2"/>,
        cName: 'nav-text',
        altName: 'panel-text'
        
    },
    {
        title: 'HELP REQUESTS',
        path: '/Help',
        icon: <img
        class="HelpRequests"
        src={HelpRequest}
        alt="icon-3"/>,
        cName: 'nav-text',
        altName: 'panel-text'
    },
    {
        title: 'PROJECT SUBMISSIONS',
        path: '/Submission',
        icon: <img
        class="ProjectSubmissions"
        src={ProjectSubmission}
        alt="icon-4"/>,
        cName: 'nav-text',
        altName: 'panel-text'
    },
    {
        title: 'PROJECT LIBRARY',
        path: '/Library',
        icon: <img
        class="ProjectLibrary"
        src={ProjectLibrary}
        alt="icon-5"/>,
        cName: 'nav-text',
        altName: 'panel-text'
    },
    
]
